// SPDX-License-Identifier: MIT
pragma solidity 0.8.23;

import {console2} from "forge-std/console2.sol";
import "@openzeppelin/contracts/utils/Address.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";

contract MultisigWallet {
    using Address for address;
    using EnumerableSet for EnumerableSet.AddressSet;

    event SubmitTransaction(address indexed owner, uint indexed txIndex, address indexed to, uint value, bytes data);
    event ConfirmTransaction(address indexed owner, uint indexed txIndex);
    event ExecuteTransaction(address indexed owner, uint indexed txIndex);
    event Deposit(address indexed sender, uint value);
    event VendorProposed(address indexed vendor);
    event VendorApproved(address indexed vendor);
    event VendorConfirmed(address indexed vendor);
    event OwnerListed(address indexed owner);

    EnumerableSet.AddressSet private owners;
    uint public required;

    struct Transaction {
        address to;
        uint value;
        bytes data;
        bool executed;
        uint confirmations;
    }

    Transaction[] public transactions;
    mapping(uint => mapping(address => bool)) public isConfirmed;

    mapping(address => uint) public vendorProposals;
    mapping(address => bool) public isVendorConfirmed;

    modifier onlyOwner() {
        require(isOwner(msg.sender), "caller is not an owner");
        _;
    }

    constructor(address[] memory _owners, uint _required) {
        require(_owners.length > 0, "owners required");
        require(_required > 0 && _required <= _owners.length, "invalid required number of owners");

        for (uint i = 0; i < _owners.length; i++) {
            require(_owners[i] != address(0), "invalid owner");
            require(!owners.contains(_owners[i]), "owner not unique");

            owners.add(_owners[i]);
        }

        required = _required;
    }

    function isOwner(address account) public view returns (bool) {
        return owners.contains(account);
    }

    function proposeVendor(address _vendor) external onlyOwner {
        require(_vendor != address(0), "Invalid vendor address");
        require(vendorProposals[_vendor] == 0, "Vendor already proposed");

        vendorProposals[_vendor] = 1;
        emit VendorProposed(_vendor);
    }

    function approveVendor(address _vendor) external onlyOwner {
        require(_vendor != address(0), "Invalid Vendor Address");
        require(vendorProposals[_vendor] > 0, "Vendor not proposed");
        require(!isVendorConfirmed[_vendor], "Vendor already confirmed");

        if (vendorProposals[_vendor] < required) {
            vendorProposals[_vendor]++;
            emit VendorApproved(_vendor);
        }

        if (vendorProposals[_vendor] >= required && !isVendorConfirmed[_vendor]) {
            isVendorConfirmed[_vendor] = true;
            emit VendorConfirmed(_vendor);
        }
    }

    function submitTransaction(address _to, uint _value, bytes calldata _data) external onlyOwner {
        uint txIndex = transactions.length;

        transactions.push(Transaction({
            to: _to,
            value: _value,
            data: _data,
            executed: false,
            confirmations: 0
        }));

        emit SubmitTransaction(msg.sender, txIndex, _to, _value, _data);
    }

    function approveTransaction(uint _txIndex) external onlyOwner {
        require(_txIndex < transactions.length, "tx does not exist");
        require(!isConfirmed[_txIndex][msg.sender], "tx already confirmed");

        transactions[_txIndex].confirmations += 1;
        isConfirmed[_txIndex][msg.sender] = true;

        emit ConfirmTransaction(msg.sender, _txIndex);
    }

    function executeTransaction(uint _txIndex) external onlyOwner {
        require(_txIndex < transactions.length, "tx does not exist");
        Transaction storage transaction = transactions[_txIndex];

        require(!transaction.executed, "tx already executed");
        require(transaction.confirmations >= required || isVendorConfirmed[transaction.to], "cannot execute tx");

        transaction.executed = true;
        (bool success,) = transaction.to.call{value: transaction.value}(transaction.data);
        require(success, "tx failed");

        emit ExecuteTransaction(msg.sender, _txIndex);
    }

    receive() external payable {
        emit Deposit(msg.sender, msg.value);
    }
}

